description:
&quot;Y lleg&amp;oacute; un dia como jam&amp;aacute;s se vio, en el que los h&amp;eacute;roes m&amp;aacute;s poderosos de la Tierra se unieron contra una amenaza com&amp;uacute;n.
Ese fue el dia en que nacieron los Vengadores... &amp;iexcl;para combatir a aquellos enemigos a los que ning&amp;uacute;n h&amp;eacute;roe en solitario podria hacer frente!

Por separado, son los mayores h&amp;eacute;roes del mundo; nobles campeones entregados a la defensa del bien. Juntos, son la Liga de la Justicia de Am&amp;eacute;rica... &amp;iexcl;Y no se rinden ante ning&amp;uacute;n enemigo ni mal!&quot;
